    void swapChar(char &a,char &b){
        char temp=a;
        a=b;
        b=temp;
        
    }

  void reverseString(vector<char>& s) {
        int n=s.size();
       for(int i=0;i<n/2;i++){
         cout<<s[i]<<" "<<s[n-i-1]<<endl;
           swapChar(s[i],s[n-1-i]);
         cout<<s[i]<<" "<<s[n-i-1]<<endl;
       }

    }

    void subArray(vector<int>&s){
        int n=s.size();
        for(int i=0;i<n;i++){
            for(int j=i;j<n;j++){
                for(int k=i;k<=j;k++){
                    cout<<s[k]<<" ";
                }
                cout<<endl;
            }
        }
    }

    // fint minimum in rotated sorted array
      int findMin(vector<int>& nums) {
        int start=0,end=nums.size()-1;
        int ans=INT_MAX;
        while (start<=end)
        {
            int mid=start+(end-start)/2;
            if(nums[mid]>nums[0]){
                start=mid+1;
            }else{
                ans=min(ans,nums[mid]);
                end=mid-1;
            }
        }
        return ans;
    }
    // pair sum
    void twoSum(vector<int>& nums, int target) {
        int n=nums.size();
        vector<int>ans;
        for (int i = 0; i < n; i++)
        {   
            int x=target-nums[i];
           for (int j = 0; j < n; j++)
           {
            if(x==nums[j] && j!=i){
              if(i>j){
                ans.push_back(j);
                    ans.push_back(i);
                }else{
                 ans.push_back(i);
                ans.push_back(j);
                }
            goto outOfLoop;
            }
           }
          
        }
        outOfLoop:
        for(auto i:ans){
            cout<<i<<",";
        }
    }

    // merge the intervals
    void  merge(vector<vector<int>>& intervals) {
        vector<vector<int>>ans;
        int n=intervals.size();
        if(n<2){
            cout<<"not posible";
        }
        sort(intervals.begin(),intervals.end());
        ans.push_back(intervals[0]);
        for(int i=1;i<n;i++){
                 vector<int>top=ans.back();
            if(top[1]>=intervals[i][0]){
               if(top[1]<intervals[i][1]){

                top[1]=intervals[i][1];
                  ans.pop_back();
                ans.push_back(top);
               }
                else{
                    continue;
                }
              
            }else{
                ans.push_back(intervals[i]);
            }
        }
       
       for(auto i:ans){
        for(auto a:i){
            cout<<a<<",";
        }
        cout<<endl;
       }
       
    }

