    // subarray sum divisible by k
     void subarraysDivByK(vector<int>& nums, int k) {
        int n=nums.size();
        int sum=0;
        int ans=0;
        for(int i=0;i<n;i++){
            for (int j = i; j < n; j++)
            {
                sum+=nums[j];
                if(sum%k==0)
                ans++;


            }
            sum=0;
            
        }

        cout<<ans;
    }



